import ReactDOM from "react-dom/client"

const root = ReactDOM.createRoot(document.getElementById("root"))

//NAVBAR COMPONENT
function navbar()
{
  return(
    <nav>
      <h1>Perfumy</h1>
      <ul>
        <li>Home|</li>
        <li>Products|</li>
        <li>About|</li>
        <li>C</li>
      </ul>
    </nav>
  )
}

root.render()
